import React from "react";

export const Tile = (props) => {

    const object = [props.contact];

  return (
    <div className="tile-container">
      {Object.values(object.map((element,index) => {
            if(index === 0){
                return <p className="tile-title" key={index}></p>
                }else{
                  return <p className="tile" key={index}></p>
              }
            }
          )
        )
      }
    </div>
  );
};
